import React from 'react';

const TabelaValores = (props) => {

    return (
    <table>
        <thead>
        <tr>
            <th>Artist</th>
            <th>Appearances</th>
            <th>%</th>
        </tr>
        </thead>
        <tbody>
        {props.topArtists.map((artist, index) => (
            <tr key={index}>
                <td>{artist.name}</td>
                <td>{artist.appearances}</td>
                <td>{artist.percentage}</td>
            </tr>
        ))}
        </tbody>
    </table>
    );
};

export default TabelaValores;
